import React from 'react';
import { Fragment } from 'react/cjs/react.development';
import Header from './components/LAYOUT/Header';
import Meals from './components/MEALS/Meals.js';
function App() {
  return (
    <Fragment>

      <Header/>
      <main>
        <Meals/>
      </main>
    </Fragment>
  );
}

export default App;
